walkoff_version: 1.0.0
app_version: 1.0.0
name: VADER
description: Vader sentiment analysis
environment: cloud
tags:
  - vader
  - sentiment analysis
categories:
  - sentiment analysis
contact_info:
  name: Peter Clemenko
  url: https://github.com/peter-clemenko
  email: pclemenkoiii@gmail.com
actions:
  - name: sentimentAnalysis
    description:  Runs vader sentiment analysis on a string. Gets the positive, compound, neutral, and negative sentiment to determine if a statement is positive or negative.
    parameters:
      - name: text
        description: Text to analyze
        required: true
        schema:
          type: string
    returns:
      schema:
        type: string
      example: "'pos': 0.317, 'compound': 0.5249, 'neu': 0.556, 'neg': 0.127"
